import React from 'react';
import { ServerData } from '../types';
import MetricCard from './MetricCard';
import ProcessList from './ProcessList';
import SystemInfo from './SystemInfo';
import { formatDistanceToNow } from 'date-fns';
import { CatFooter } from './CatDecorations';

interface DashboardProps {
  serverData: ServerData | null;
  isConnected: boolean;
  isLoading: boolean;
}

const Dashboard: React.FC<DashboardProps> = ({ serverData, isConnected, isLoading }) => {
  if (isLoading) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="text-center">
          <div className="relative">
            <div className="animate-spin rounded-full h-16 w-16 border-4 border-purple-200 border-t-purple-600 mx-auto mb-6"></div>
            <div className="absolute inset-0 flex items-center justify-center">
              <div className="w-4 h-4 bg-gradient-to-r from-purple-500 to-pink-500 rounded-full"></div>
            </div>
          </div>
          <p className="text-gray-600 dark:text-gray-400 font-medium">
            Loading server data...
          </p>
          <p className="text-sm text-gray-500 dark:text-gray-500 mt-2">
            Gathering system information
          </p>
        </div>
      </div>
    );
  }

  if (!serverData) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="text-center">
          <div className="w-16 h-16 bg-gradient-to-r from-red-100 to-pink-100 dark:from-red-900/20 dark:to-pink-900/20 rounded-full flex items-center justify-center mx-auto mb-6 shadow-lg">
            <div className="status-indicator status-offline" />
          </div>
          <p className="text-gray-600 dark:text-gray-400 font-medium">
            {isConnected ? 'No data available' : 'Unable to connect to server'}
          </p>
          <p className="text-sm text-gray-500 dark:text-gray-500 mt-2">
            No system data available
          </p>
        </div>
      </div>
    );
  }

  const { cpu, memory, disk, processes, uptime, os, timestamp } = serverData;

  // Safely format the timestamp
  const formatTimestamp = (timestamp: Date | string) => {
    try {
      const date = timestamp instanceof Date ? timestamp : new Date(timestamp);
      if (isNaN(date.getTime())) {
        return 'Just now';
      }
      return formatDistanceToNow(date, { addSuffix: true });
    } catch (error) {
      console.error('Error formatting timestamp:', error);
      return 'Just now';
    }
  };

  return (
    <div className="space-y-8">
      {/* Status Bar */}
      <div className="card bg-gradient-to-r from-white/90 to-purple-50/90 dark:from-dark-800/90 dark:to-purple-900/20 backdrop-blur-sm border-0 shadow-xl">
        <div className="flex items-center justify-between">
          <div className="flex items-center space-x-4">
            <div className={`status-indicator ${isConnected ? 'status-online' : 'status-offline'}`} />
            <div>
              <span className="font-semibold text-lg">
                Server Status: {isConnected ? 'Online' : 'Offline'}
              </span>
              <p className="text-sm text-gray-600 dark:text-gray-400">
                {isConnected ? 'All systems operational!' : 'Server is offline'}
              </p>
            </div>
          </div>
          <div className="text-right">
            <div className="text-sm text-gray-600 dark:text-gray-400">
              Last updated: {formatTimestamp(timestamp)}
            </div>
            <div className="text-xs text-gray-500 dark:text-gray-500">
              Real-time monitoring active
            </div>
          </div>
        </div>
      </div>

      {/* Main Metrics Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
        <MetricCard
          title="CPU Usage"
          value={`${cpu.load.toFixed(1)}%`}
          subtitle={`${cpu.cores} cores • ${cpu.temperature.toFixed(1)}°C`}
          icon="cpu"
          color="blue"
          percentage={cpu.load}
        />

        <MetricCard
          title="Memory Usage"
          value={`${((memory.used / memory.total) * 100).toFixed(1)}%`}
          subtitle={`${(memory.used / 1024 / 1024 / 1024).toFixed(1)} GB / ${(memory.total / 1024 / 1024 / 1024).toFixed(1)} GB`}
          icon="memory"
          color="green"
          percentage={(memory.used / memory.total) * 100}
        />

        <MetricCard
          title="Disk Usage"
          value={`${((disk.used / disk.total) * 100).toFixed(1)}%`}
          subtitle={`${(disk.used / 1024 / 1024 / 1024).toFixed(1)} GB / ${(disk.total / 1024 / 1024 / 1024).toFixed(1)} GB`}
          icon="disk"
          color="purple"
          percentage={(disk.used / disk.total) * 100}
        />
      </div>

      {/* System Information and Processes */}
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
        <SystemInfo uptime={uptime} os={os} />
        <ProcessList processes={processes} />
      </div>

      {/* Cat-themed footer */}
      <CatFooter />
    </div>
  );
};

export default Dashboard;
